import { Carousel } from "react-carousel-minimal";
import imgProduct01 from "../../images/image-product-1.jpg";
import imgProduct02 from "../../images/image-product-2.jpg";
import imgProduct03 from "../../images/image-product-3.jpg";
import imgProduct04 from "../../images/image-product-4.jpg";

function Modal() {
  const data = [
    {
      image: imgProduct01,
    },
    {
      image: imgProduct02,
    },
    {
      image: imgProduct03,
    },
    {
      image: imgProduct04,
    },
  ];

  const captionStyle = {
    fontSize: "2em",
    fontWeight: "bold",
  };
  const slideNumberStyle = {
    fontSize: "20px",
    fontWeight: "bold",
  };
  return (
    <div className="modal flex items-center justify-center absolute inset-0 bg-opacity">
      <div className="lg:w-3/12 lg:h-3/12 md:w-5/12 md:h-5/12 w-3/6 h-3/6 relative">
        <div
          style={{
            padding: "0 20px",
          }}
        >
          <Carousel
            data={data}
            time={false}
            width="850px"
            height="500px"
            radius="25px"
            // slideNumber={true}
            // slideNumberStyle={slideNumberStyle}
            // captionPosition="bottom"
            // dots={true}
            // slideBackgroundColor="darkgrey"
            // slideImageFit="cover"
            thumbnails={true}
            thumbnailWidth="20%"
            style={{
              textAlign: "center",
              maxWidth: "850px",
              maxHeight: "500px",
              margin: "40px ",
            }}
          />
        </div>
      </div>
    </div>
  );
}

export default Modal;
